import React from 'react';
import { useState } from 'react';
import { default as JSPDF } from 'jspdf';

const PDFGenerator = (item) => {
  const [isHovered, setIsHovered] = React.useState(false);

  const buttonDownload = {
    textDecoration: 'underline',  // Adiciona sublinhado
    fontWeight: 'bold',           // Torna o texto negrito
    color: 'white',                // Cor do texto em branco
    backgroundColor: '#990000',        // Cor de fundo vermelho
    padding: '10px 20px',          // Adiciona algum espaçamento interno ao botão
    border: 'none',                // Remove a borda (opcional)
    cursor: 'pointer'               // Adiciona um cursor de ponteiro para indicar que é clicável
  };

  const hoverStyles = {
    ...buttonDownload,
    backgroundColor: '#cc0000', // New background color on hover
  };

  const generatePDF = (item) => {
    // Create a new jsPDF instance
    const doc = new JSPDF('p', 'mm', [297, 210]);    
    const atleta = item.item["Atleta"]
    const categoria = item.item["Categoria"]
    const divisao = item.item["Divisao"]
    console.log('Generating PDF with rowData:', divisao);
    
    // Add image
    const imageUrl = " data:image/jpeg;base64,";
    doc.addImage(imageUrl, 'PNG', 0,0, 210,150);
    
    // Set font styles
    doc.setFont('cursive', 'italic', 'bold');
    doc.setFontSize(20);
    
      // Add certificate content
    doc.text('Certificate of Completion', 105, 30, { align: 'center'});
    doc.setFont('cursive', 'italic', 'normal');
    doc.setFontSize(14);

    doc.text('This is to certify that', 105, 50, { align: 'center' });
    doc.text(atleta, 105, 60, { align: 'center', underline: true  });
    doc.text('________________________________________________', 105, 60, { align: 'center' });
    doc.text('has successfully completed the category', 105, 70, { align: 'center' });
    doc.text(categoria, 105, 80, { align: 'center' });
    doc.text('___________________________________', 105, 80, { align: 'center' });
    doc.text(' on the weapon: ', 105, 90, { align: 'center' });
    doc.text(divisao, 105, 100, { align: 'center' });
    doc.text('___________________________________', 105, 100, { align: 'center' });

    doc.text('Date: ' + new Date().toLocaleDateString(), 105, 140, { align: 'center' });

    // Add underlined name

    // Add a signature-like text
    doc.text('Instructor Signature', 105, 160, { align: 'center' });

    // Save the PDF as a blob
    const pdfBlob = doc.output('blob');

    // Create a download link and trigger the download
    const downloadLink = document.createElement('a');
    downloadLink.href = URL.createObjectURL(pdfBlob);
    downloadLink.download = 'generated-document.pdf';
    downloadLink.click();
  };

  return (
    <div>
      <button onClick={() => generatePDF(item)}  
      style={isHovered ? hoverStyles : buttonDownload}
      onMouseEnter={() => setIsHovered(true)}
      onMouseLeave={() => setIsHovered(false)} >Baixar meu Certificado</button>
    </div>
    
  );
  
};


export default PDFGenerator;
